import React from 'react';
import axios from 'axios';

import * as config from "../services/config";
import UserAccountTable from '../components/UserAccountsTable';

class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            users: [],
            showModal: false,
            startDate: new Date()
        };
    }

    handleChange = date => {
        this.setState({
            startDate: date
        });
    };

    componentDidMount() {
        axios.get(config.userAccountManagementBackendUrl)
            .then(res => {
                console.log(res.data);
                this.setState({
                    users: res.data
                });

            }).catch((err) => {
            console.log(err)
        });
    }

    render() {
        const users = this.state.users;
        return (
            <div>
                <UserAccountTable users={users}></UserAccountTable>
            </div>
        )
    }

}

export default Main;
